import React from 'react';
import { get } from 'http';


export default class profile extends React.Component{
    constructor(props){
        super(props);
        this.state={};
    }
    async componentWillMount(){
        await get(
           '/data/user/get',
           {'Content-Type':'application/json'}
       )
       .then(data=>data.json())
       .then(function(data){
           this.setState({data:data});
       })
       .catch(console.log)
    }
    render(){
        return(
            <div>heyy{this.state['data']}</div>
        );
    }
}
